import { Container, Stack, Typography } from '@mui/material';
import React, { useState } from 'react';
import Sample from './Assests/AssestPhotoSample.jpg'

import { CustomLink, Assest } from './Components/Components';

import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";

import ToggleButton from '@mui/material/ToggleButton';
import ToggleButtonGroup from '@mui/material/ToggleButtonGroup';

function App() {

  const [alignment, setAlignment] = React.useState('web');

  const handleChange = (event, newAlignment) => {
    setAlignment(newAlignment);
  };

  return (
    <Container fixed>
      <Typography m="10px" variant='h5'>Explore</Typography>
      <Router>
        <Stack direction="row" mb="10px">
          <ToggleButtonGroup
            color="primary"
            value={alignment}
            exclusive
            onChange={handleChange}
            aria-label="Platform"
          >


            <ToggleButton value="web">
              <CustomLink to="/#" placeholder="All" />
            </ToggleButton>
            <ToggleButton value="android">
              <CustomLink to="/gaming" placeholder="Gaming" />
            </ToggleButton>
            <ToggleButton value="ios">
              <CustomLink to="/art" placeholder="Art" />
            </ToggleButton>
            <ToggleButton value="ios">
              <CustomLink to="/art" placeholder="Art" />
            </ToggleButton>
          </ToggleButtonGroup>

        </Stack>
        <Routes>
          <Route index element={<All />} />
          <Route path='/gaming' element={
            <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
            </Stack>
          } />
          <Route path='/art' element={
            <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
            </Stack>
          } />
          <Route path='/photography' element={
            <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
            </Stack>
          } />

        </Routes>
      </Router>

      {/* <Stack direction="row" >
        <Typography variant='h6'>All</Typography>
        <Typography variant='h5'>Gaming</Typography>
        <Typography variant='h5'>Art</Typography>
        <Typography variant='h5'>Photography</Typography>
      </Stack>
      <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
      </Stack> */}
    </Container>
  );
}

export default App;

function All() {
  return (
    <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
    </Stack>
  )
}
